import "tailwindcss/tailwind.css";
import { Navbar } from "../components/NavBar";
import { Page } from "../components/Page";

function MyApp({ Component, pageProps }) {
  return (
    <Page>
      <Navbar />
      <Component {...pageProps} />
    </Page>
  );
}

export default MyApp;
